INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (7, "フリーマーケット会場", 10118, "青空の下で謁見", 0, 1, "ペコリーヌとの出会い", 2834, 8, 5118061, 2, 20063115, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (7, "フリーマーケット会場", 10118, "未来の騎空団\nマスコット？", 0, 1, "マホとの出会い", 2835, 8, 5118062, 2, 20063115, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (7, "ランドソル市街地", 10118, "お嬢さまからの\n緊急依頼", 0, 1, "アキノとの出会い", 2837, 8, 5118063, 2, 20063115, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (18, "フリーマーケット会場", 10118, "黄金色の悩みごと", 0, 1, "ジュンとの出会い", 4108402, 8, 5118064, 2, 20063115, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (18, "フリーマーケット会場", 10118, "白熱！　格闘大会！", 0, 1, "カオリとの出会い", 4107402, 8, 5118065, 2, 20063115, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (16, "オーエド町", 10118, "祭り太鼓はオーエドの華", 1, 1, "ニノンとの出会い", 9000227, 8, 5118066, 2, 20063115, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (19, "フリーマーケット会場", 10118, "人気者は遅れて\nやってくる", 0, 1, "スズナとの出会い", 2101181, 8, 5118067, 3, 20063115, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (18, "ランドソル市街地", 10118, "巫女・ミーツ・魔法少女", 0, 1, "ナナカとの出会い", 4109402, 8, 5118068, 3, 20063115, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (18, "フリーマーケット会場", 10118, "ネズ耳は二度なくなる", 0, 1, "キャル＆コッコロとの出会い", 4305402, 8, 5118069, 3, 20063115, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (18, "ランドソル市街地", 10118, "この出会いにカンパイ！", 0, 1, "ユカリとの出会い", 4101402, 8, 5118070, 3, 20063115, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (18, "ランドソル市街地", 10118, "陰陽アンサンブル", 0, 1, "アオイとの出会い", 4106402, 8, 5118071, 3, 20063115, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (7, "フリーマーケット会場", 10118, "運試し十番勝負！", 1, 1, "シノブとの出会い", 2836, 8, 5118072, 3, 20063115, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, 40);
INSERT INTO `v1_f4836ac242c13606be6a7d3e14f9c2c3580061d7d3494e9879dfd8729d9df70c` VALUES (0, 0, 10118, "彼女たちの新たな日常", 0, 0, "オープニング", 0, 0, 5118600, 1, 20063115, 0, 0, 0);
